              contentGrid: { xs: 6, sm: 10, md: 8, lg: 9 },
            }}
            tabs={[
              {
                tabButton: "Passwords",
                tabIcon: LockOpenIcon,
                tabContent: (
                  <span>
                    <MaterialTable
                      title="Your Credentials"
                      columns={state.columns}
                      data={state.data}
                      editable={{
                        onRowAdd: (newData) =>
                          new Promise((resolve) => {
                            setTimeout(() => {
                              resolve();
                              setState((prevState) => {
                                const data = [...prevState.data];
                                data.push(newData);
                                return { ...prevState, data };
                              });
                            }, 600);
                          }),
                        onRowUpdate: (newData, oldData) =>
                          new Promise((resolve) => {
                            setTimeout(() => {
                              resolve();
                              if (oldData) {
                                setState((prevState) => {
                                  const data = [...prevState.data];
                                  data[data.indexOf(oldData)] = newData;
                                  return { ...prevState, data };
                                });
                              }
                            }, 600);
                          }),
                        onRowDelete: (oldData) =>
                          new Promise((resolve) => {
                            setTimeout(() => {
                              resolve();
                              setState((prevState) => {
                                const data = [...prevState.data];
                                data.splice(data.indexOf(oldData), 1);
                                return { ...prevState, data };
                              });
                            }, 600);
                          }),
                      }}
                    />
                  </span>
                ),
              },
              {
                tabButton: "Payments",
                tabIcon: PaymentIcon,
                tabContent: (
                  <span>
                    <p>
                      Efficiently unleash cross-media information without
